import ReactDOM from 'react-dom';

const name = "Madiha";
const imgs = "https://picsum.photos/200/300"

ReactDOM.render(
    <>
        <h1> Hello my name is: {name}</h1>
        <img src={imgs} alt='Random images'/>
    </>,
    document.getElementById('root')
);
